import { memo, useState, useEffect, Fragment } from "react";
import "./styles.css";

export const ApplePhone = memo(function ApplePhone() {
  const position = {
    position: "absolute",
    top: "18%",
    left: "11%",
    width: "81%",
    aspectRatio: "289 / 495" //"76 / 131"
  };

  const Device = ({ children }) => (
    <div
      className="device-frame"
      style={{
        position: "relative",
        //backgroundImage: "url(./img/sonim-XP7-frame.png)"
        backgroundImage: "linear-gradient(hsl(0,0%,0%),hsl(0,0%,0%))",
        backgroundSize: "90% 70%",
        backgroundPosition: "center",
        top: 0,
        left: 0,
        bottom: 0,
        right: 0,
        //aspectRatio: "284 / 578"
        aspectRatio: "315 / 612" //"631 / 1225"
      }}
    >
      <div
        className="device-frame"
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          bottom: 0,
          right: 0,
          zIndex: 5,
          aspectRatio: "284 / 578",
          backgroundSize: "contain",
          // backgroundImage: "url(./img/sonim-XP7-frame.png)"
          ...iphone64,
          boxShadow: "2rem "
        }}
      />

      {children}
    </div>
  );

  const Frames = () => (
    <Fragment>
      <div
        className={
          "image cycle keyframe1" /*`image ${keyframe !== 0 ? "hide" : ""}`*/
        }
        style={{
          //opacity: keyframe !== 0 ? 0 : 1,
          // zIndex: 3,
          backgroundImage: "url(./img/audiohand-00.png)",
          ...position
        }}
      />
      <div
        className={
          "image cycle keyframe2" /*`image ${keyframe === 0 ? "hide" : ""}`*/
        }
        style={{
          // opacity: keyframe === 0 ? 0 : 1,
          // zIndex: 2,
          backgroundImage: "url(./img/audiohand-02.png)",
          ...position
        }}
      />
      <div
        className="image keyframe3"
        style={{
          // opacity: keyframe !== 2 ? 0 : 1,
          // zIndex: 1,
          backgroundImage: "url(./img/audiohand-01.png)",
          ...position
        }}
      />
    </Fragment>
  );

  return (
    <Device>
      <Frames />
    </Device>
  );
});

const iphone64 = {
  backgroundImage:
    "url(data:image/png;base64,)"
};

